  [],\n\t\"revision_timestamp\": \"2015-05-06T21:47:40.434580\",\n\t\"name\": \"multi-disciplinary-multi-fidelity-design-environment-project-8f474\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Phoenix Integration will develop a collaborative
  simulation and design environment that will seamlessly integrate the people, data,
  and tools required for analyzing and designing complete vehicle systems. This next
  generation environment will help NASA to accurately assess and trade-off competing
  air vehicle concepts early in the design process. Working within the environment,
  geographically distributed team members will be able to easily construct large multi-disciplinary
  multi-fidelity system simulations from a custom library of reusable analysis components.
  A key feature of the environment will be \"numerical zooming\", i.e. the ability
  to incorporate numerical analyses of varying levels of fidelity in the simulation.
  Interfaces and tools will be provided that will allow users to configure the system
  simulation and securely execute it using heterogeneous computing resources. A simulation
  data library will allow users to share models, results, and conclusions with one
  another, and will serve as a searchable information repository. The expected results
  of the Phase I research will be a working prototype that will demonstrate key aspects
  of the proposed design environment. The Phase II program will result in a comprehensive
  framework environment that will help NASA achieve Fundamental Aeronautics Program
  goals for a broad range of air vehicles.\",\n\t\"license_title\": \"U.S. Government
